                    <h2 className="headers2">Full-Stack Web Developer</h2>
                    <h2 className="headers2">B.S. in Electrical Engineering</h2>
                </Col>
                <Col sm={4} >
                    <Image className="profile-picture" src={profile} roundedCircle />
                </Col>
            </Row>
            <div className="about-me">
                <p>
